Дорогие мой девушки, поговорим сегодня о СЧАСТЬЕ.❤

Что чувствуете, когда произносите это слово?
Произнесите его прямо сейчас вслух... и прислушайтесь к себе... Что шепчут эмоции? Как реагирует тело?
 
Ощущаете вы боль и пустоту?🙈
Или мурашки, радость, легкость, "ваууу"-эффект🔥🎉

У каждого есть свое представления о счастье. Для кого-то это быть здоровой, иметь семью, детей. Или: "Ну наконец-то носки на свое место положил!"😃 Это может быть карьера, своё дело, новая страна.💼✈ Или встретить своего любимого человека, чтобы химия совпадала 👫♥️
✅ на эту тему будет отдельный пост❗

Но если мы в самом деле вдумаемся, что такое счастье, раскрывается важное познание:
✅ Счастья, это означает позволить себе быть самой собой! Так как состояние счастья всегда связано с осознанием себя. Кто я, что мне нравится, а что нет; кто или что мне подходит, кто делает меня здоровой, счастливой, а кто/ что зарывает заживо?

Часто встречается такая ситуация: Представьте себе девушку, назовём её например Светланой. Она выучилась на одну профессию, получила титул доктора в этой сфере деятельности, но чувствует поганым чувством, что
всё равно чего-то не хватает.
"А чего нехватает?" -- "А без понятия.", отвечает наша Светлана.
И когда ей становиться 30, 40, 50 или 60 лет⏳она эмоционально просыпается (но не все просыпаются❗) останавливается и спрашивает себя: "Что я делаю?"🤔🙈
И понимает, что это не её путь. А всё, поздно, поезд ушел.

Но у нас ещё, девушки, есть самолёты!✈😃

✅💡В этом моменте осознания она наконец-то может себе дать возможность, быть самой собой. Делать то, что ей нравится.

Ну что, дорогие мои, что почувствовали? Что означает для вас БЫТЬ СЧАСТЛИВОЙ? Что или кто делает вас несчастной? 
Можете ли вы себе сейчас сказать: Да, я счастлива!❤🎆🎉

Заберите пост в закладки -- обязательно пригодится.💯👉

